	add("ethane", "{\"term\":\"ethane\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|eth|ane|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An aliphatic hydrocarbon, C\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;6\u0026lt;/sub\u0026gt;, gaseous at normal temperatures and pressures, being a constituent of natural gas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The same compound, subjected to modification by replacing one or more of the hydrogen atoms with other radicals\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chlorinated \u0027\u0027ethanes\u0027\u0027; halogenated \u0027\u0027ethanes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1959\u0027\u0027, A. F. Trotman-Dickenson, \u0027Free Radicals: An Introduction\u0027, [http://books.google.com/books?id\u003dmeIOAAAAQAAJ\u0026amp;pg\u003dPA45\u0026amp;dq\u003d%22ethanes%22\u0026amp;hl\u003den\u0026amp;ei\u003dLTpnTpfXD-X6mAXNt43MDA\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d3\u0026amp;ved\u003d0CDEQ6AEwAjg\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22ethanes%22\u0026amp;f\u003dfalse page 45\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The dissociation constants for \u0027\u0027ethanes\u0027\u0027 in which the two halves of the molecule are different are not always close to the mean of the dissociation constants of the corresponding symmetrical \u0027\u0027ethanes\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027, \u0027Transactions of the Faraday Society\u0027, Volume 64, [http://books.google.com/books?id\u003dTyUrBkqOnRUC\u0026amp;q\u003d%22ethanes%22\u0026amp;dq\u003d%22ethanes%22\u0026amp;hl\u003den\u0026amp;ei\u003dTzpnTqaLM4GkmQWB6bCsDA\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d8\u0026amp;ved\u003d0CEYQ6AEwBzgo page 1573\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Analysis of the ethane fraction also revealed anomalous deuteration of the ethane, the \u0027\u0027ethanes\u0027\u0027 C\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;5\u0026lt;/sub\u0026gt;D, C\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;4\u0026lt;/sub\u0026gt;D\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt; and C\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;D\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt; being observed as well as C\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;6\u0026lt;/sub\u0026gt;. \u0027\u0027Ethanes\u0027\u0027 with more than three D atoms were not detected\", \"priority\":8}]}, \"synonyms\":{}}");

