	add("ethanol", "{\"term\":\"ethanol\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Contracted from \u0027ethyl\u0027 + \u0027alcohol\u0027 \u0027\u0027 (ethyl) is from Ancient greek (to 1453) \u0027αἰθήρ\u0027 (ether) influenced by German \u0027äthyl\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A simple aliphatic alcohol formally derived from ethane by replacing one hydrogen atom with a hydroxyl group: CH\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;-CH\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;-OH\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Specifically\u0027, this alcohol as a fuel\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 January 26, w:Ted Ted Strickland, Ohio State of the State Address, 05:25–39\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In 2007, not one drop of \u0027\u0027ethanol\u0027\u0027 was produced in Ohio. Today, four \u0027\u0027ethanol\u0027\u0027 facilities in Ohio are producing two hundred and ninety-five million gallons annually\", \"priority\":4}]}, \"synonyms\":{}}");

	add("ethanolamine", "{\"term\":\"ethanolamine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|ethanol|amine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a hydroxy-amine, HO.CH\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;.CH\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;.NH\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;, manufactured by the reaction of ethylene oxide with ammonia; it is found naturally in a combined form in cephalin, and has many industrial applications\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethea", "{\"term\":\"ethea\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From the Ancient greek (to 1453) \u0027ἤθεα\u0027 the uncontracted nominative plural form of \u0027ἦθος\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027: John Herbert Parsons, \u0027Mind and the Nation: a précis of applied psychology\u0027, p2\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"From them sprang, all with a sense of dividing and mapping out boundaries, Moira (Destiny) and Nomos (Law), Nemos (Sanctuary) and Nemesis (Avenging Anger or Righteous Indignation), \u0027\u0027Ethea\u0027\u0027, the haunts of the country in which one ranges, and so customs, established behaviour, habits\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027: Eva Hauel Cadwallader, \u0027Searchlight on Values: Nicolai Hartmann’s Twentieth-century Value Platonism\u0027, p9\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Hartmann means this interpretation of what most would call historical historical relativism to apply also to the contemporaneous diversity of \u0027\u0027ethea\u0027\u0027 among cultures, sub-cultures, and (evidently) individuals who adopt the viewpoint of one of these\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027: Richard T. Hull, \u0027A Quarter Century of Value Inquiry\u0027, p18\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"These three valuational attitudes form a triangle of mutually opposing \u0027\u0027ethea\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027: Charles E. Scott, \u0027On the Advantages and Disadvantages of Ethics and Politics\u0027, p4\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The question arises from a limited ethos combined with its universalization, which transgresses its own limits, and its claim to authority over other \u0027\u0027ethea\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027: Charles Olson et alii, \u0027Collected Prose\u0027, p35\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A politics of the order of the Athenian Three has no more person or \u0027\u0027ethea\u0027\u0027 in it — has only a psyche of halve to logos and their false conjunction supported by an invented episteme, an invented noun instead of a participle\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027: Michael J. Hyde, \u0027The Ethos of Rhetoric\u0027, pXV\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"This question echoes the earliest use of ethos that dates back to Homer and Hesiod, influences Isocrates’ theory of rhetoric and moral character, and, as Charles Chamberlain notes, “refers to the range or arena where someone is most truly at home and which underlies all the fine appearances [‘habits’ and ‘customs’: also \u0027\u0027ethea\u0027\u0027] that people adopt”\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027: Chanju Mun, \u0027Buddhism And Peace: Theory And Practice\u0027, p22\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The place of this region is called the \u0027\u0027ethea\u0027\u0027 of animals and refers to the place outside the domain of Greek culture, to the place of the barbarian who resists domestication\", \"priority\":14}]}, \"synonyms\":{}}");

	add("ether", "{\"term\":\"ether\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027ether\u0027 from Latin \u0027aether\u0027 (the upper pure, bright air) from Ancient greek (to 1453) \u0027αἰθήρ\u0027 (upper air) from \u0027αἴθω\u0027 (i burn, shine)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The god/personification of the bright, glowing upper air of heaven. He is the Roman counterpart of Aether\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The ancient American prophet of Mormon theology who wrote the Book of Ether in the Book of Mormon\", \"priority\":2}]}, \"synonyms\":{}}");

