	add("etherealness", "{\"term\":\"etherealness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|ethereal|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being ethereal\", \"priority\":1}]}, \"synonyms\":{}}");

	add("etherin", "{\"term\":\"etherin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|ether|in|lang\u003den}}?\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A white crystalline hydrocarbon, regarded as a polymeric variety of ethylene, obtained in heavy oil of wine, the residue left after making ether\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethernet", "{\"term\":\"ethernet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A set of network cabling and network access (CSMA/CD) protocol standards for bus topology computer networks invented by Xerox but now controlled by the 802.3 subcommittee of the IEEE\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A computer network which complies with such set of standards\", \"priority\":2}]}, \"synonyms\":{}}");

	add("ethicalness", "{\"term\":\"ethicalness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being ethical\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027, Timothy L. S. Sprigge, \u0026quot;Definition of a Moral Judgment,\u0026quot; \u0027Philosophy\u0027, vol. 39, no. 150, p. 306\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Some have thought that universalisability was the criterion of \u0027\u0027ethicalness\", \"priority\":3}]}, \"synonyms\":{}}");

	add("ethics", "{\"term\":\"ethics\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|ethique}}, from {{m|la|ethica}}, from Ancient greek (to 1453) {{m|grc|ἠθική}}, from {{m|grc|ἠθικός||of or for morals, moral, expressing character}}, from {{m|grc|ἦθος||character, moral nature}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of principles relating to right and wrong conduct\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Morality\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The standards that govern the conduct of a person, especially a member of a profession\", \"priority\":3}]}, \"synonyms\":{}}");

	add("ethidium", "{\"term\":\"ethidium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The cationic form of a polycyclic aromatic base, \u0027name 3,8-Diamino-5-ethyl-6-phenylphenanthridinium\u0027, whose bromide is used as a stain for nucleic acids\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethion", "{\"term\":\"ethion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An organophosphate insecticide, [dethoxyphosphinothioylthio)methylthio]-diethoxy-thioxophosphorane, that is known to neutralise the neural enzyme acetylcholinesterase\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, Committee on Prototype Explicit Analyses for Pesticides, Commission on Natural Resources, Environmental Studies Board, \u0027Regulating Pesticides\u0027, [http://books.google.com.au/books?id\u003dzf3C3lfX5FQC\u0026amp;pg\u003dPA156\u0026amp;dq\u003d%22ethion%22%7C%22ethions%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003diYgIU67zLI-ZkgWU14D4Dg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22ethion%22%7C%22ethions%22\u0026amp;f\u003dfalse page 156\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The substantial polarity of \u0027\u0027ethion\u0027\u0027 indicated by its molar refraction (100.1) probably indicates a strong adsorption on surfaces. \u0027\u0027Ethion\u0027\u0027 may therefore persist as a surface residue allowing dermal exposure if reentry occurs before photochemical destruction or hydrolysis\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, T. S. S. Dikshith, \u0027Toxicological Study of Pesticides in Animals\u0027, [http://books.google.com.au/books?id\u003dQewdXlpdV5UC\u0026amp;pg\u003dPA20\u0026amp;dq\u003d%22ethion%22%7C%22ethions%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003diYgIU67zLI-ZkgWU14D4Dg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22ethion%22%7C%22ethions%22\u0026amp;f\u003dfalse page 20\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Ethion\u0027\u0027 is a colorless to amber colored liquid. It is soluble in most organic solvents including kerosine, but sparingly soluble in water. \u0027\u0027Ethion\u0027\u0027 is highly toxic to animals\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Claire Franklin, John Worgan, \u0027Occupational and Residential Exposure Assessment for Pesticides\u0027, [http://books.google.com.au/books?id\u003d6XDS4GCofRwC\u0026amp;pg\u003dPA29\u0026amp;dq\u003d%22ethion%22%7C%22ethions%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003diYgIU67zLI-ZkgWU14D4Dg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22ethion%22%7C%22ethions%22\u0026amp;f\u003dfalse page 29\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Salivary concentration of \u0027\u0027ethion\u0027\u0027 was measured among pesticide applicators (Nigg et al., 1993). Elevated salivary ethion levels were observed in applicators following \u0027\u0027ethion\u0027\u0027 spraying as compared to controls, and urinary metabolites levels and salivary \u0027\u0027ethion\u0027\u0027 levels were somewhat correlated (\u0027r\u0027 \u003d 0.55), hence leading the authors to conclude that saliva could be used to confirm \u0027\u0027ethion\u0027\u0027 exposure\", \"priority\":10}]}, \"synonyms\":{}}");

	add("ethiopia", "{\"term\":\"ethiopia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027lang\u003dgrc\u0027 from \u0027lang\u003dgrc|αἰθίοψ\u0027 () from \u0027lang\u003dgrc|αἴθω\u0027 () + \u0027lang\u003dgrc|ὤψ\u0027 () \u0027(Disputed)\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Country in Eastern Africa. Official name: Federal Democratic Republic of Ethiopia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"sub-Saharan Sub-Saharan Africa, especially the parts south of Egypt and along and east of the Nile\", \"priority\":2}]}, \"synonyms\":{}}");

	add("ethiopian", "{\"term\":\"ethiopian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Ethiopia|an|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person from Ethiopia or of Ethiopian descent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A black-skinned person\", \"priority\":2}]}, \"synonyms\":{}}");

	add("ethnicity", "{\"term\":\"ethnicity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|ethnic|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The common characteristics of a group of people\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003dRace volume\u003d100|issue\u003d2|page\u003d164|magazine\u003d|url\u003dhttp://www.americanscientist.org/bookshelf/pub/race-finished|passage\u003dFew concepts are as emotionally charged as that of race. The word conjures up a mixture of associations—culture, \u0027\u0027ethnicity\u0027\u0027, genetics, subjugation, exclusion and persecution. But is the tragic history of efforts to define groups of people by race really a matter of the misuse of science, the abuse of a valid biological concept\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An ethnic group\", \"priority\":3}]}, \"synonyms\":{}}");

	add("ethnicization", "{\"term\":\"ethnicization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|ethnic|ization|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of making or becoming ethnic; ethnization\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, C. Richard King, ‎Carmen R. Lugo-Lugo, ‎Mary K. Bloodsworth-Lugo, \u0027Animating Difference\u0027 (ISBN 0742560813), page 41\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For instance, not only is Oscar racialized as black, we can also see an \u0027\u0027ethnicization\u0027\u0027 of race whereby Oscar is constructed as a black American\", \"priority\":3}]}, \"synonyms\":{}}");

	add("ethnicon", "{\"term\":\"ethnicon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἐθνικόν\u0027 () neuter gender of \u0027ἐθνικός\u0027 (national)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"name of a tribe, ethnonym\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnization", "{\"term\":\"ethnization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|ethno|ization|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of making a group into, or of becoming as a group, an ethnicity or distinct people\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, \u0027Ethnologia Europaea\u0027, volumes 27-29, page 148\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This \u0027\u0027ethnization\u0027\u0027 observed by Bukow and Llaryora in the conceptualization of newly immigrated minorities can also be observed with regard to \u0026quot;resident\u0026quot; minorities like the Sorbs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, \u0027Education for Democratic Citizenship\u0027 (ISBN 1136470247), page 10\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The minority groups show no strong tendency towards \u0027\u0027ethnization\u0027\u0027; the formation of groups is hardly used as an instrument to gain a better position in the labor market, the housing market, or education, if at all\", \"priority\":5}]}, \"synonyms\":{}}");

	add("ethnoanthropology", "{\"term\":\"ethnoanthropology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|ethno|anthropology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the ethnological aspects of anthropology\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnoarchaeology", "{\"term\":\"ethnoarchaeology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|ethno|archaeology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ethnographic study of peoples for archaeological reasons\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnobiology", "{\"term\":\"ethnobiology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|ethno|biology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the relationships between plants and animals and human cultures\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnocentrism", "{\"term\":\"ethnocentrism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|ethno|centrism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The tendency to look at the world primarily from the perspective of one\u0027s own traditional, deferred, or adoptive ethnic culture\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnocide", "{\"term\":\"ethnocide\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|ethno|cide|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The deliberate and systematic destruction of an ethnic group, accomplished either by destroying the members of the group (genocide) or by destroying its cultural identity (culturcide\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnocracy", "{\"term\":\"ethnocracy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|ethno|cracy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of government in which a particular ethnic group holds a disproportionate amount of government power\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnogamy", "{\"term\":\"ethnogamy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Endogamy specific to ethnicity; the social practice of marriage restricted to one\u0027s own ethnicity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1898\u0027\u0027, W. J. McGee, \u0027The Seri Indians\u0027, Government Printing Office, [http://books.google.com/books?id\u003dR6QTAAAAYAAJ\u0026amp;pg\u003dRA2-PA284\u0026amp;dq\u003dethnogamy\u0026amp;lr\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"PRA2-PA284,M1 pg. 284\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"For convenience, this plane and the mode of marriage defining it may, in special allusion to the correlative race-sense, be styled \u0027\u0027ethnogamy\u0027\u0027; and the more systematic characters of this mode and plane of marriage may be outlined briefly\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, Karigoudar Ishwaran, \u0027Family Kinship and Community: A Study of Dutch Canadians: a Developmental Approach\u0027, McGraw-Hill Ryerson, pg. 149\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The marriage pattern in Holland Marsh may be described as ethnic endogamy, or \u0027\u0027ethnogamy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Gaby Semaan, \u0026quot;Arab Americans Unveil the Building Blocks in the Construction of Our Cultural Identity,\u0026quot; Ph.D. Thesis, December 2007, [http://www.ohiolink.edu/etd/send-pdf.cgi/Semaan%20Gaby.pdf?acc_num\u003dbgsu1187204165 pg. 56] (PDF\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I have chosen \u0027\u0027ethnogamy\u0027\u0027 as one of the dependent variables because the choice of a marriage mate is one of the measures of cultural perseverance\", \"priority\":8}]}, \"synonyms\":{}}");

	add("ethnogenesis", "{\"term\":\"ethnogenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|ethno|genesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The emergence of a distinct, recognizable, ethnic identity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnography", "{\"term\":\"ethnography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|ethno|graphy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The branch of anthropology that scientifically describes specific human cultures and societies\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnohistory", "{\"term\":\"ethnohistory\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|ethno|history|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The history of an indigenous people\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnoknowledge", "{\"term\":\"ethnoknowledge\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|ethno|knowledge|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"traditional folk knowledge\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnolect", "{\"term\":\"ethnolect\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|ethno|lect|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A language variety specific to an ethnic group\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Ebonics is an \u0027\u0027ethnolect\u0027\u0027 of African Americans\", \"priority\":2}]}, \"synonyms\":{}}");

	add("ethnolinguist", "{\"term\":\"ethnolinguist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{back-form|ethnolinguistics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A scholar of ethnolinguistics; a linguistic anthropologist who studies the language of a specific ethnic group\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnolinguistics", "{\"term\":\"ethnolinguistics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|ethno|linguistics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The field of linguistic anthropology which studies the language of a specific ethnic group\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnology", "{\"term\":\"ethnology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἔθνος\u0027 (a people, nation) + \u0027-λογία\u0027 (-logy, branch of study, to speak)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The branch of anthropology that studies and compares the different human cultures\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnomathematics", "{\"term\":\"ethnomathematics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* Term coined in 1977 by Brazilian mathematician Ubiratan D\u0027Ambrosio\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the interrelationship between mathematics and culture\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnomedicine", "{\"term\":\"ethnomedicine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|ethno|medicine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"traditional folk-medicine\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnomethodology", "{\"term\":\"ethnomethodology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|ethno|methodology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An academic discipline that attempts to understand the social orders people use to make sense of the world through analysing their accounts and descriptions of their day-to-day experiences\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnomusicologist", "{\"term\":\"ethnomusicologist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|ethnomusicology|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A researcher in the field of ethnomusicolog\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnonymics", "{\"term\":\"ethnonymics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{affix|en|ethnonym|-ics}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of ethnonyms\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnonymy", "{\"term\":\"ethnonymy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|ethnonym|y|lang\u003den}}, from {{confix|ethn|onym|t1\u003dpertaining to races|t2\u003dthe name of|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the naming of people, the creation of ethnonyms\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnopharmacology", "{\"term\":\"ethnopharmacology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|ethno|pharmacology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The scientific study correlating ethnic groups, their health, and how it relates to their physical habits and methodology in creating and using medicines\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnopharmacy", "{\"term\":\"ethnopharmacy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|ethno|pharmacy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An interdisciplinary science that investigates the perception and use of pharmaceuticals (especially traditional medicines) in human society\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnophilia", "{\"term\":\"ethnophilia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Greek, from ethnos, people. See s(w)e- in Indo-European Roots. Origin:, from Gk philía friendship, affinity; see -phile, -ia\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Unnatural obsession with ethnicity or race\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994,\u0027\u0027 Yuri Slezkine, \u0026quot;The USSR as a Communal Apartment, or How a Socialist State Promoted Ethnic Particularism,\u0026quot; \u0027Slavic Review\u0027, Vol. 53, No. 2., 414-415 [http://links.jstor.org/sici?sici\u003d0037-6779%28199422%2953%3A2%3C414%3ATUAACA%3E2.0.CO%3B2-V\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Non-Russian nationalism of all kinds appeared so natural and the Russian version of marxist universalism appeared so natural or so universalist, that most of these scholars failed to notice the chronic \u0027\u0027ethnophilia\u0027\u0027 of the Soviet regime[...]\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000,\u0027\u0027 Alberto Spektorowski, \u0026quot;The French New Right: Differentialism and the Idea of Ethnophilian Exclusionism,\u0026quot; \u0027Polity\u0027, Vol. 33, No. 2., 293 [http://links.jstor.org/sici?sici\u003d0032-3497%28200024%2933%3A2%3C283%3ATFNRDA%3E2.0.CO%3B2-Q\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;This shift from National-Socialism and \u0026quot;racist ethnophobia\u0026quot; to cultural \u0027\u0027ethnophilia\u0027\u0027 does not transform the New Right into a non-racist movement.\u0026quot\", \"priority\":5}]}, \"synonyms\":{}}");

	add("ethnopluralism", "{\"term\":\"ethnopluralism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|ethno|pluralism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A right-wing theory of multiculturalism, supporting separatism, and according to which cultures are bound to specific geographic locations\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnopoetics", "{\"term\":\"ethnopoetics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|ethno|poetics|lang\u003den}}, coined in 1968 by Jerome Rothenberg and George Quasha.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A poetical, linguistic and anthropological movement dealing with poetry written by, or in the style of, indigenous peoples\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnopolitics", "{\"term\":\"ethnopolitics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"politics as it relates to different ethnic groups\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethnoscape", "{\"term\":\"ethnoscape\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|ethno|scape|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A transnational distribution of correlated people\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The landscapes of group identity — the \u0027\u0027ethnoscapes\u0027\u0027 — around the world are no longer familiar anthropological objects, insofar as groups are no longer tightly territorialized, spatially bounded, historically unselfconscious, or culturally homogeneous\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Katrina Z. S. Schwartz, \u0027Nature and National Identity After Communism\u0027, page 200\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Is an \u0027\u0027ethnoscape\u0027\u0027 preserved as a tourist attraction still an ethnoscape? In the English case, David Lowenthal suspects it is not: “The heritage landscape is less and less England, more and more \u0027England-land,\u0027 Europe\u0027s offshore theme park\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Elisabeth Robertson Kennedy, \u0027Seeking a Homeland: Sojourn and Ethnic Identity in the Ancestral Narratives of Genesis\u0027, Volume 106 of Biblical Interpretation Series, [https://books.google.com/books?id\u003dyx03UKqYJdoC\u0026amp;pg\u003dPA234\u0026amp;dq\u003d%22The+divine+command+to+Isaac+in+26:3+to+sojourn+in+a+land+promised+as+a+future+possession+accents+a+flexible+relation+to+the+ethnoscape,+one+that+serves+ethnic+identity.%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnmY1VYi-IIOkyQT_mYEQ\u0026amp;ved\u003d0CB4Q6AEwA\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22The%20divine%20command%20to%20Isaac%20in%2026%3A3%20to%20sojourn%20in%20a%20land%20promised%20as%20a%20future%20possession%20accents%20a%20flexible%20relation%20to%20the%20ethnoscape%2C%20one%20that%20serves%20ethnic%20identity.%22\u0026amp;f\u003dfalse page 234\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The divine command to Isaac in 26:3 to sojourn in a land promised as a future possession accents a flexible relation to the \u0027\u0027ethnoscape\u0027\u0027, one that serves ethnic identity\", \"priority\":7}]}, \"synonyms\":{}}");

	add("ethos", "{\"term\":\"ethos\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἦθος\u0027 (character; custom, habit)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The character or fundamental values of a person, people, culture, or movement\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A form of rhetoric in which the writer or speaker invokes their authority, competence or expertise in an attempt to persuade others that their view is correct\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The traits in a work of art which express the ideal or typic character, as influenced by the ethos (character or fundamental values) of a people, rather than realistic or emotional situations or individual character in a narrow sense; opposed to\", \"priority\":3}]}, \"synonyms\":{}}");

	add("ethology", "{\"term\":\"ethology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From the Latin {{m|la|ēthologia||the art of depicting \u0027or\u0027 imitating character}}, from the Ancient greek (to 1453) \u0027ἠθολογία\u0027 (painting of character, especially by mimic gestures) from \u0027ἠθολόγος\u0027 (painting character by mimic gestures) from \u0027ἦθος\u0027 (character”, especially “\u0027moral\u0027 character)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The scientific study of human and animal behaviour\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The study of the human ethos\", \"priority\":2}]}, \"synonyms\":{}}");

	add("ethosuximide", "{\"term\":\"ethosuximide\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A particular anticonvulsant drug\", \"priority\":1}]}, \"synonyms\":{}}");

