	add("ethoxycyclohexane", "{\"term\":\"ethoxycyclohexane\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"cyclohexyl ethyl ether\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethyl", "{\"term\":\"ethyl\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"From German \u0027ethyl\u0027 from \u0027ether\u0027 + \u0027-yl\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The univalent hydrocarbon radical, C\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;5\u0026lt;/sub\u0026gt;, formally derived from ethane by the loss of a hydrogen atom\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethyldichloroarsine", "{\"term\":\"ethyldichloroarsine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A highly toxic organoarsenic compound with the chemical formula CH\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;CH\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;AsCl\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;, historically used in chemical warfare\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethylene", "{\"term\":\"ethylene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|ethyl|ene|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The common name for the organic chemical compound ethene. The simplest alkene, a colorless gaseous (at room temperature and pressure) hydrocarbon with the chemical formula C\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;4\u0026lt;/sub\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The divalent radical derived from thumb|Chemical Structure of Ethylene\", \"priority\":2}]}, \"synonyms\":{}}");

	add("ethylhydrocupreine", "{\"term\":\"ethylhydrocupreine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chemical used in cell culture to distinguish \u0027Streptococcus pneumoniae\u0027 from other alpha-hemolytic streptococci such as \u0027Streptococcus viridans\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethylmethylketone", "{\"term\":\"ethylmethylketone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The industrial solvent butanone\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethylmorphine", "{\"term\":\"ethylmorphine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A particular narcotic antitussive\", \"priority\":1}]}, \"synonyms\":{}}");

	add("ethyne", "{\"term\":\"ethyne\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The official IUPAC name for the organic chemical compound acetylene. The simplest alkyne, a colorless gaseous (at room temperature and pressure) hydrocarbon with the chemical formula thumb|Chemical structure of ethyne\", \"priority\":1}]}, \"synonyms\":{}}");

